Shefin.addCommand(
  { pattern: 'cmfor ?(.*)', fromMe: true, desc: "Forward replied msg." },
  async (message, match) => {
    let [caption, duration, url] = match.split(";")
    if (match == "") return await message.sendMessage("*Use by Given format*\nExample .cmfor caption;99;https://i.imgur.com/Mc2cOrh.jpeg jid2 jid3 jid4 ...");
    if (!message.reply_message)
      return await message.sendMessage("*Reply to a Message*");
   
    const buff = await getBuffer(url)
    let options = {} 
    
    
  options.duration = duration
    
   
    
    options.ptt = true // delete this if not need audio as voice always
    options.quoted = {
      key: {
        fromMe: false,
        participant: "0@s.whatsapp.net",
        remoteJid: "status@broadcast"
      },
      message: {
        "imageMessage": {
          "jpegThumbnail": buff.buffer,
          "caption": caption
        }
      }
    }

    match.match(parseJid).map((jid) => {
      forwardOrBroadCast(jid, message, options);
    });
  }
);

